For those who may be unaware, Cirez D is one of a few production aliases for the talented and much respected Eric Prydz.


The Original production was released in 2005.  The new remix package has only just recently landed, sporting the Original, 2 remix versions by Deadmau5 and a Tech House remix by the very well reputed Oliver Huntemann.


As per usual, I present the winner.



